import '../css/MenuBar.css';
import React from 'react';
import logo from '../resources/logo.png';

export default class MenuBar extends React.Component {
  render() {
    const { toggleRegister } = this.props;
    return (
      <div id="menu-bar">
        <p style={{ marginLeft: "1rem" }}>Rules</p>
        <div id="yousub">
          <img src={`${logo}?${new Date().getTime()}`} alt="Logo" />
          <p>yousub.</p>
        </div>
        <div onClick={toggleRegister} style={{ marginRight: "1rem" }}>Register
        </div>
      </div>
    );
  }
}
